  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Yukon
  Delta National Wildlife Refuge outlines Refuge accomplishments during the 1984 calendar
  year.  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the master plan, the management plan, public participation, and research and investigations.
  Refuge administration is outlined; information about personnel, youth programs,
  volunteer programs, funding, and safety is given. Habitat management is also covered;
  subjects include wetlands, forests, grazing, fire management, and wilderness areas.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, marine mammals, fisheries resources, and marking and banding. The
  public uses of the Refuge described in this report include outdoor classrooms, interpretive
  programs, hunting, fishing, trapping, outdoor recreation, and law enforcement. The
  equipment and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment replacement, and communication systems.
  Items of interest are provided at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
